column8:
古い角質を浮き上がらせ、キメ細かくハリのある肌に整える粉末タイプのパックです。<br>
ビタミン・ミネラル・葉緑素を豊富に含む、クマザサの一種「クマイザサ」の粉末を配合し、<br>
合成色素・防腐剤を使わずに作りました。薄い緑はクマイザサの天然葉緑素の色です。<br>
毎日のお手入れの最後にファンデーションとしてお使いいただくと、<br>
サラッと軽い仕上がりで、お肌がとても楽です。<br>
<br>

■全成分■<br>

カオリン、タルク、クマイザサ葉、プロテアーゼ、リン酸2Na、リン酸K、銅クロロフィリンNa、オクチルドデカノール<br>

内容量：60g<br>


